import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'

function HomePage() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {

      if (result.error) {
        throw result.error
      } 
      setData(result)
    })
    .catch(err => {
      setData([err.error])
    })

  }, []);

  if (data[0].length === 1) {
    console.log('found the error')
    return ('error')
  } 

  return (
  <div>
    Welcome to Next.js!
    <list>  
      { 
        data.map(item => {
          return <li key={Math.random()}>
            <strong>User: </strong>{item.user_name}
          </li>
        })
      } 
    </list>
  </div>
  )
}

export default HomePage
